description:
The application is designed for sending the Passenger Customs Declaration.

Disclaimer:

The application is an official product of the Customs Committee of the Republic of Uzbekistan and represents their opinion, and the developer is not responsible for changes in the policy or actions of the government agency;

Responsibility for the relevance of the information lies with the Customs Committee of the Republic of Uzbekistan, which provides the data;

This application provides information obtained from official government sources, such as cusotms.uz, lex.uz and other sites, as well as through the API of the Customs Committee of the Republic of Uzbekistan;

All materials presented in the application are based on data provided by the Customs Committee of the Republic of Uzbekistan;

This application was developed at the request of the Customs Committee of the Republic of Uzbekistan, but the developer is not an official representative or authority (based on the letter of the Customs Committee dated 25.02.2025 No. 6 / 05-25-00060). The application is provided solely for use in forming and sending a passenger customs declaration when crossing the border of the Republic of Uzbekistan.
